//#region Context for NIST PKITS tests

function simpleVerification(params: {
  trustedCertificates: string[];
  certificates: string[];
  crls: string[];
  successExpected: boolean;
  verifyParameters?: CertificateChainValidationEngineVerifyParams;
}) {
  return async () => {
    //#region Initial variables
    const trustedCerts: pkijs.Certificate[] = [];
    const certs: pkijs.Certificate[] = [];
    const crls: pkijs.CertificateRevocationList[] = [];
    //#endregion

    //#region Initialize certificates
    function initializeTrustedCertificates() {
      for (let i = 0; i < params.trustedCertificates.length; i++) {
        const certRaw = pkitsToArrayBuffer(PKITS.certs[params.trustedCertificates[i]]);
        trustedCerts.push(pkijs.Certificate.fromBER(certRaw));
      }
    }

    assert.doesNotThrow(initializeTrustedCertificates, Error, "Successfully initialize trusted root certificates");
    //#endregion

    //#region Initialize intermediate and end entity certificates
    function initializeIntermediateCertificates() {
      for (let i = 0; i < params.certificates.length; i++) {
        const certRaw = pkitsToArrayBuffer(PKITS.certs[params.certificates[i]]);
        certs.push(pkijs.Certificate.fromBER(certRaw));
      }
    }

    assert.doesNotThrow(initializeIntermediateCertificates, Error, "Successfully initialize intermediate and end entity certificates");
    //#endregion

    //#region Initialize CRLs
    function initializeCRLs() {
      for (let i = 0; i < params.crls.length; i++) {
        const crlRaw = pkitsToArrayBuffer(PKITS.crls[params.crls[i]]);
        crls.push(pkijs.CertificateRevocationList.fromBER(crlRaw));
      }
    }

    assert.doesNotThrow(initializeCRLs, Error, "Successfully initialize CRLs");
    //#endregion

    const certChain = new pkijs.CertificateChainValidationEngine({
      trustedCerts,
      certs,
      crls
    });

    if (params.successExpected) {
      const result = await certChain.verify(params.verifyParameters || {});
      if (!result.result) {
        throw new Error(`Successfull verification expected, but FAILED return: ${result.resultMessage}`);
      }
    } else {
      const result = await certChain.verify(params.verifyParameters || {});
      if (result.result)
        throw new Error("Fail on verification expected, but SUCCESS return");
    }

  };
}

